import styled from "styled-components";
import MainSecTitleCTA from './MainSecTitleCTA'
import MainSecVideoCTA from './MainSecVideoCTA'
import MainSecButtonCTA from './MainSecButtonCTA'

const SectionCTA = styled.section`
    width: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
`

function Section02(){
    return (
        <SectionCTA>
            <div></div>
            <MainSecTitleCTA />
            <MainSecVideoCTA />
            <MainSecButtonCTA />
        </SectionCTA>
    )
}

export default Section02
